  render() {
    const missionElement = missions.map((mission) => (
      <MissionCard
        key={ mission.name }
        name={ mission.name }
        year={ mission.year }
        country={ mission.country }
        destination={ mission.destination }
      />));

    return (
      <div className="missions" data-testid="missions">
        <Title headline="MissÃµes" />
        { missionElement }
      </div>
    );
  }
}

